import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import './Home.css';

function Home() {
    const navigate = useNavigate();
    const [sessionId, setSessionId] = useState('');
    const [username, setUsername] = useState('');
    const [error, setError] = useState('');

    const handleCreateSession = () => {
        if (!username.trim()) {
            setError('Please enter your username');
            return;
        }
        navigate('/create', { state: { username } });
    };

    const handleJoinSession = () => {
        if (!username.trim()) {
            setError('Please enter your username');
            return;
        }
        if (!sessionId.trim()) {
            setError('Please enter a session ID');
            return;
        }
        navigate(`/lobby/${sessionId}`, { state: { username } });
    };

    return (
        <div className="page-container">
            <div className="page-header">
                <h1 className="page-title">Crossword Multiplayer</h1>
                <p className="page-subtitle">
                    Compete or collaborate in real-time crossword puzzles
                </p>
            </div>

            <div className="content-card">
                <div className="form-group">
                    <label className="form-label">Your Username</label>
                    <input
                        type="text"
                        className="form-input"
                        placeholder="Enter your username"
                        value={username}
                        onChange={(e) => {
                            setUsername(e.target.value);
                            setError('');
                        }}
                        maxLength={20}
                    />
                </div>

                {error && <div className="error-message">{error}</div>}

                <div className="home-actions">
                    <button
                        className="btn-primary btn-full"
                        onClick={handleCreateSession}
                    >
                        Create New Game
                    </button>

                    <div className="divider">
                        <span>OR</span>
                    </div>

                    <div className="form-group">
                        <label className="form-label">Join Existing Game</label>
                        <input
                            type="text"
                            className="form-input"
                            placeholder="Enter session ID"
                            value={sessionId}
                            onChange={(e) => {
                                setSessionId(e.target.value);
                                setError('');
                            }}
                        />
                    </div>

                    <button
                        className="btn-secondary btn-full"
                        onClick={handleJoinSession}
                    >
                        Join Game
                    </button>
                </div>

                <div className="features">
                    <div className="feature">
                        <div className="feature-icon">üèÜ</div>
                        <div className="feature-text">
                            <h3>Competitive Mode</h3>
                            <p>Race against others with individual grids</p>
                        </div>
                    </div>
                    <div className="feature">
                        <div className="feature-icon">ü§ù</div>
                        <div className="feature-text">
                            <h3>Co-op Mode</h3>
                            <p>Work together on a shared crossword</p>
                        </div>
                    </div>
                    <div className="feature">
                        <div className="feature-icon">‚ö°</div>
                        <div className="feature-text">
                            <h3>Real-Time</h3>
                            <p>Up to 30 players with live updates</p>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default Home;
